import React from 'react';
import './Home.css';

interface HomeProps {
  onSelectSchool: (schoolName: string) => void;
}

const Home: React.FC<HomeProps> = ({ onSelectSchool }) => {
  const schools = [
    {
      id: 1,
      name: 'REDSTAR',
      image: '/REDSTAR.JPG',
    },
    {
      id: 2,
      name: 'SANTA SURF PROCENTER',
      image: '/SANTASURF-PROCENTER.JPG',
    },
    {
      id: 3,
      name: 'LANZAROTE SURF SCHOOL',
      image: '/LANZAROTE.jpg',
    },
    {
      id: 4,
      name: 'ZOOPARK',
      image: '/ZOOPARK.jpg',
    },
    {
      id: 5,
      name: 'MAURI SURF',
      image: '/MAURI-SURF.JPG',
    },
    {
      id: 6,
      name: 'JMC SURFTRAINING',
      image: '/JMC-SURFTRAINING.jpg',
    },
    {
      id: 7,
      name: 'VOLCANO',
      image: '/VOLCANO.jpg',
    },
    {
      id: 8,
      name: 'OTRAS',
      image: '/OTRAS.jpg',
    },
  ];

  return (
    <div className="home">
      {/* Hero Principal */}
      <section className="hero-section">
        <div className="hero-background">
          <img 
            src="/home.jpg" 
            alt="Surf en Lanzarote" 
            className="hero-image"
          />
          <div className="hero-overlay"></div>
        </div>

        <div className="hero-content">
          <h1 className="hero-title">Encuentra tus fotos de surf en Lanzarote</h1>
          <p className="hero-subtitle">Reconocimiento facial inteligente · Descarga inmediata · Pago seguro</p>
          <button className="btn btn-primary btn-large" onClick={() => {
            window.location.href = '/schools';
          }}>
            Buscar mis fotos
          </button>
        </div>
      </section>

      {/* Sección de Características */}
      <section className="features-section">
        <div className="section-wrapper">
          <h2 className="features-title">¿Cómo funciona?</h2>
          <div className="features-grid">
            <div className="feature-card">
              <div className="feature-icon">
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" d="M12 21v-8.25M15.75 21v-8.25M8.25 21v-8.25M3 9l9-6 9 6m-1.5 12V10.332A48.36 48.36 0 0012 9.75c-2.551 0-5.056.2-7.5.582V21M3 21h18M12 6.75h.008v.008H12V6.75z" />
                </svg>
              </div>
              <h3 className="feature-title">Elige tu escuela</h3>
              <p className="feature-description">Selecciona la escuela donde hiciste tu clase de surf</p>
            </div>

            <div className="feature-card">
              <div className="feature-icon">
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" d="M6.827 6.175A2.31 2.31 0 015.186 7.23c-.38.054-.757.112-1.134.175C2.999 7.58 2.25 8.507 2.25 9.574V18a2.25 2.25 0 002.25 2.25h15A2.25 2.25 0 0021.75 18V9.574c0-1.067-.75-1.994-1.802-2.169a47.865 47.865 0 00-1.134-.175 2.31 2.31 0 01-1.64-1.055l-.822-1.316a2.192 2.192 0 00-1.736-1.039 48.774 48.774 0 00-5.232 0 2.192 2.192 0 00-1.736 1.039l-.821 1.316z" />
                  <path strokeLinecap="round" strokeLinejoin="round" d="M16.5 12.75a4.5 4.5 0 11-9 0 4.5 4.5 0 019 0zM18.75 10.5h.008v.008h-.008V10.5z" />
                </svg>
              </div>
              <h3 className="feature-title">Sube un selfie</h3>
              <p className="feature-description">La IA buscará automáticamente tus fotos</p>
            </div>

            <div className="feature-card">
              <div className="feature-icon">
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" d="M3 16.5v2.25A2.25 2.25 0 005.25 21h13.5A2.25 2.25 0 0021 18.75V16.5M16.5 12L12 16.5m0 0L7.5 12m4.5 4.5V3" />
                </svg>
              </div>
              <h3 className="feature-title">Descarga tus fotos</h3>
              <p className="feature-description">Obtén tus fotos al instante sin marca de agua</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
